// ABTestCreator.tsx

import React, { useState } from 'react';
import ABTestService from '../../services/api';
// import the 


interface ABTestFormData {
  sample_size: number;
  start_date: string;
  variant_identifier: string;
  control_identifier: string;
  end_date: string;
  variant_segment: number;
  control_segment: number;
  visitors: number;
  site_name: string;
}

const CreateTest: React.FC = () => {
  const [formData, setFormData] = useState<ABTestFormData>({
    sample_size: 0,
    start_date: '',
    variant_identifier: '',
    control_identifier: '',
    end_date: '',
    variant_segment: 0,
    control_segment: 0,
    visitors: 0,
    site_name: '',
  });

  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();

    try {
      await ABTestService.createTest(formData);
      alert('Test created successfully');
    } catch (error) {
      console.error('Error creating test:', error);
      alert('Failed to create test');
    }
  };

  return (
    <div className="abtest-creator">
      <h2 className="form-title">Create A/B Test</h2>
      <form className="abtest-creator-form" onSubmit={handleSubmit}>
        <div className="form-card">
          <h3 className="form-card-title">General Information</h3>
          <div className="form-group">
            <label htmlFor="site_name">Site Name</label>
            <input
              type="text"
              id="site_name"
              name="site_name"
              value={formData.site_name}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
        </div>
        <div className="form-card">
          <h3 className="form-card-title">A/B Test Details</h3>
          <div className="form-group">
            <label htmlFor="sample_size">Sample Size</label>
            <input
              type="number"
              id="sample_size"
              name="sample_size"
              value={formData.sample_size}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="start_date">Start Date</label>
            <input
              type="datetime-local"
              id="start_date"
              name="start_date"
              value={formData.start_date}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="variant_identifier">Variant Identifier</label>
            <input
              type="text"
              id="variant_identifier"
              name="variant_identifier"
              value={formData.variant_identifier}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="control_identifier">Control Identifier</label>
            <input
              type="text"
              id="control_identifier"
              name="control_identifier"
              value={formData.control_identifier}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="end_date">End Date</label>
            <input
              type="datetime-local"
              id="end_date"
              name="end_date"
              value={formData.end_date}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="variant_segment">Variant Segment</label>
            <input
              type="number"
              id="variant_segment"
              name="variant_segment"
              value={formData.variant_segment}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="control_segment">Control Segment</label>
            <input
              type="number"
              id="control_segment"
              name="control_segment"
              value={formData.control_segment}
              onChange={handleInputChange}
              className="form-input"
              required
            />
          </div>
        </div>
        <div className="form-group">
          <button type="submit" className="btn-submit">
            Create Test
          </button>
        </div>
      </form>
    </div>
  );
};

export default CreateTest;
